import datetime
import random
import string

bookshelf = {}

print("Welcome to Library!\n")

while True:
    print("Add book")
    add_book = {}

    add_book["Title"] = input("Masukkan judul: ")
    add_book["Author"] = input("Masukkan penulis: ")
    add_book["Publication Date"] = input("Masukkan tahun terbit: ")

    year = int(input("Masukkan tahun terakhir dipinjam (YYYY): "))
    month = int(input("Masukkan bulan terakhir dipinjam (1-12): "))
    date = int(input("Masukkan tanggal terakhir dipinjam (1-31): "))
    add_book["tanggal_terakhir_dipinjam"] = datetime.datetime(year, month, date)

    borrow = input("Is the book still available? (y/n): ").lower()
    if borrow == "y":
        add_book["status"] = True
    else:
        add_book["status"] = False

    key = "".join([random.choice(string.ascii_uppercase) for i in range(6)])

    bookshelf[key] = add_book
    print("\nSukses:", key)
    print("\nDaftar Buku di Lemari:\n")
    print(f"{'KEYS':<10} {'JUDUL':<20} {'PENULIS':<20} {'TAHUN':<10} {'TERAKHIR DIPINJAM':<20} {'STATUS':<10}")
    print("-" * 90)
    for i, pinjam in bookshelf.items():
        terakhir_dipinjam = pinjam['tanggal_terakhir_dipinjam'].strftime("%Y-%m-%d")
        status = "Tersedia" if pinjam['status'] else "Tidak"
        print(f"{i:<10} {pinjam['Title']:<20} {pinjam['Author']:<20} {pinjam['Publication Date']:<10} {terakhir_dipinjam:<20} {status:<10}")

    more = input("\nWant more books? (y/n): ").lower()
    if more != "y":
        print("Thank you for your visit!")
        break

